-----------------------------------Create database-----------------------------------------------------------------------------------------

CREATE DATABASE IF NOT EXISTS fitness;

-----------------------------------Import tables-------------------------------------------------------------------------------------------


CREATE TABLE hourlysteps(
   Id           NVARCHAR(10) NOT NULL
  ,ActivityHour VARCHAR(19) NOT NULL
  ,StepTotal    INTEGER  NOT NULL
);





CREATE TABLE IF NOT EXISTS `dailyActivity_merged` (
    `Id` BIGINT,
    `ActivityDate` DATETIME,
    `TotalSteps` INT,
    `TotalDistance` NUMERIC(3, 1),
    `TrackerDistance` NUMERIC(3, 1),
    `LoggedActivitiesDistance` INT,
    `VeryActiveDistance` NUMERIC(3, 1),
    `ModeratelyActiveDistance` NUMERIC(2, 1),
    `LightActiveDistance` NUMERIC(3, 1),
    `SedentaryActiveDistance` INT,
    `VeryActiveMinutes` INT,
    `FairlyActiveMinutes` INT,
    `LightlyActiveMinutes` INT,
    `SedentaryMinutes` INT,
    `Calories` INT
);



CREATE TABLE Sleepday_merged(
   Id                 NVARCHAR(10) NOT NULL
  ,SleepDay           DATE  NOT NULL
  ,TotalSleepRecords  INTEGER  NOT NULL
  ,TotalMinutesAsleep INTEGER  NOT NULL
  ,TotalTimeInBed     INTEGER  NOT NULL
);
